const grpc = require('grpc');
const implementation = require('./clientimpl');
var protoLoader = require('@grpc/proto-loader');

const USER_PROTO_PATH = '../../proto/userhandler.proto';

var createPackageDef = (path) =>protoLoader.loadSync(
    path,
    {keepCase: true,
     longs: String,
     enums: String,
     defaults: true,
     oneofs: true
    });

var userhandler = grpc.loadPackageDefinition(createPackageDef(USER_PROTO_PATH)).userhandler;

var userClient = new userhandler.UserHandler('localhost:8081',
                                       grpc.credentials.createInsecure());


module.exports = {
	loginWithAccess(token){
		implementation.login(userClient, token);
	}
}
